/* eslint-disable max-len,no-script-url,jsx-a11y/anchor-is-valid */
import React from "react";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import Table from "@material-ui/core/Table";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import CardHeader from "@material-ui/core/CardHeader";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import purple from "@material-ui/core/colors/purple";
import Grid from "@material-ui/core/Grid";
import Container from "@material-ui/core/Container";

const Places = () => (
  <Card className={"MuiElevatedCard--01"}>
    <CardHeader
      className={"MuiCardHeader-root"}
      title={"Desserts"}
      subheader={"Select your favourite"}
      classes={{
        title: "MuiCardHeader-title",
        subheader: "MuiCardHeader-subheader"
      }}
    />
  </Card>
);

Places.getTheme = muiBaseTheme => {
  const offset = 40;
  const cardShadow = "0px 14px 80px rgba(34, 35, 58, 0.2)";
  const headerShadow = "4px 4px 20px 1px rgba(0, 0, 0, 0.2)";
  return {
    MuiCard: {
      root: {
        "&.MuiElevatedCard--01": {
          marginTop: offset,
          borderRadius: muiBaseTheme.spacing.unit / 2,
          transition: "0.3s",
          boxShadow: cardShadow,
          position: "relative",
          width: "90%",
          overflow: "initial",
          background: "#ffffff",
          padding: `${muiBaseTheme.spacing.unit * 2}px 0`,
          "& .MuiCardHeader-root": {
            flexShrink: 0,
            position: "absolute",
            top: -offset,
            right: 20,
            left: 20,
            borderRadius: muiBaseTheme.spacing.unit / 2,
            backgroundColor: purple[500],
            overflow: "hidden",
            boxShadow: headerShadow,
            textAlign: "left",
            "& .MuiCardHeader-title": {
              color: "#ffffff",
              fontWeight: 900,
              letterSpacing: 1
            },
            "& .MuiCardHeader-subheader": {
              color: "#ffffff",
              opacity: 0.87,
              fontWeight: 200,
              letterSpacing: 0.4
            }
          },
          "& .MuiCardContent-root": {
            textAlign: "left",
            "& .MuiCardContent-inner": {
              paddingTop: "38px",
              overflowX: "auto"
            }
          }
        }
      }
    }
  };
};

Places.metadata = {
  name: "Elevated Card Header I",
  description: "Wonderful elevated card header"
};

// export default ElevatedCardHeader01;

export default Places;
